import axios from "axios"
import * as types from "../type"

export const getMoviePage = (page) => async(dispath) => {
    try {
        const result = axios.get(`https://ophim1.com/danh-sach/phim-moi-cap-nhat?page=${page}`)
        dispath({type: types.GET_MOVIE_PAGE})
    } catch (error) {
        console.log("Get movie API error",error)
    }
}
